import styled from 'styled-components';

const MyButton = styled.button`
  background-color: orange;
  color: black;
  font-size: 10px;
  padding: 10px 20px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

export default MyButton;
